interface TestProps {
  name: string;
  className?: string;
}

export default function Test({ name, className }: TestProps) {
  const svgPathObject = TechList.find((item) => item.name === name);

  if (!svgPathObject) {
    return null;
  }

  const { path } = svgPathObject;
  const color = svgPathObject.color;
  return (
    <svg
      role="img"
      viewBox="0 0 24 24"
      xmlns="http://www.w3.org/2000/svg"
      className={`${className} `}
      fill={color}
      style={{ color: color }}
    >
      <title>{name}</title>
      <path d={path} />
    </svg>
  );
}
